      FROM CMN_CODE
     WHERE CD  = I_RCD;

  ELSIF I_TYPE = 'CD_PRP10' THEN

    SELECT CD_PRP10
      INTO O_CD_INFO
      FROM CMN_CODE
     WHERE CD  = I_RCD;

  ELSIF I_TYPE = 'CD_PRP11' THEN

    SELECT CD_PRP11
