--  DDL for Function F_CMN_FILE_INFO
--------------------------------------------------------
CREATE OR REPLACE FUNCTION "F_CMN_FILE_INFO"
(
     I_FILE_SERIAL_NO		NUMBER
    ,I_DIV							VARCHAR2	:= 'CNT'
) RETURN VARCHAR2 IS

/******************************************************************************
   NAME:       F_CMN_FILE_INFO
   PURPOSE:   첨부파일정보 조회
   REVISIONS:
   Ver        Date        Author           Description
   ---------  ----------  ---------------  ------------------------------------
   NOTES:
   파라미터 1(I_FILE_SERIAL_NO)   :   파일순번
   파라미터 2(I_DIV)              :   구분값(CNT:첨부파일갯수, FULL:파일명)
******************************************************************************/

    O_FILE_INFO 	CMN_ATTC_FILE.FILE_NM%TYPE;
    V_FILE_CNT		NUMBER;
		V_FILE_NM			CMN_ATTC_FILE.FILE_NM%TYPE;

BEGIN
	SELECT COUNT(*)
      INTO V_FILE_CNT
      FROM CMN_ATTC_FILE
     WHERE ATTC_FILE_NO = I_FILE_SERIAL_NO
       AND FILE_STAT_RCD = 'CMN101.SAVE';

  	SELECT FILE_NM
      INTO V_FILE_NM
      FROM CMN_ATTC_FILE T1
     WHERE ATTC_FILE_NO = I_FILE_SERIAL_NO
       AND FILE_STAT_RCD = 'CMN101.SAVE'
       AND ROWNUM = 1
     ORDER BY SEQ DESC;
	
    IF I_DIV = 'CNT' THEN
      O_FILE_INFO := V_FILE_CNT || '건';
    ELSE
	  	IF V_FILE_CNT > 1 THEN
	  		O_FILE_INFO := V_FILE_NM || '외 ' || (V_FILE_CNT-1) || '건';
	    ELSE
	      O_FILE_INFO := V_FILE_NM;
	    END IF;
	END IF;

  RETURN O_FILE_INFO;

EXCEPTION
   WHEN NO_DATA_FOUND THEN RETURN('');
   WHEN OTHERS 				THEN RETURN('');
END F_CMN_FILE_INFO;

